import { ChangeEvent, FormEvent, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";

interface FormData {
  userId: string;
  password: string;
}

export const LoginAdmin: React.FC = () => {
  const navigation = useNavigate();
  const [userId, setUserId] = useState("");
  const [password, setPassword] = useState("");

  const handleChangeUserId = (event: ChangeEvent<HTMLInputElement>) =>
    setUserId(event.target.value);

  const handleChangePass = (event: ChangeEvent<HTMLInputElement>) =>
    setUserId(event.target.value);

  const handleSubmit = async (event: FormEvent<HTMLFormElement>) => {
    event.preventDefault();
    try {
      const data = await axios.post("/api/posts", userId, password);
    } catch (e) {
      console.log("エラー:", e);
    }
  };

  return (
    <div>
      <h1>管理者ログイン画面</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="ユーザID"
          name="userId"
          value={userId}
          onChange={handleChangeUserId}
        />
        <br />
        <input
          type="password"
          placeholder="パスワード"
          name="password"
          value={password}
          onChange={handleChangePass}
        />
        <button type="submit">ログイン</button>
      </form>
      <Link to="/">TOPへ戻る</Link>
    </div>
  );
};
